/**
 * Constructor.
 * @param innerIter Underlying DocIdSetIterator.
 */
public FilteredDocIdSetIterator(DocIdSetIterator innerIter) {
  if (innerIter == null) {
    throw new IllegalArgumentException("null iterator");
  }
  _innerIter = innerIter;
  _currentDoc = -1;
}

/**
 * Constructor.
 * @param innerIter Underlying DocIdSetIterator.
 */
public FilteredDocIdSetIterator(DocIdSetIterator innerIter) {
  if (innerIter == null) {
    throw new IllegalArgumentException("null iterator");
  }
  _innerIter = innerIter;
  doc = -1;
}

